import React from 'react';
import './CSS/App.css';
import Nav from './Nav';
import Page_Principale from './Components/Page_Principale';
import Page_Admin from './Components/Page_Admin';
import Home from './Home';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
function App() {
    return(
        <Router>
            <div className="App">
                <Nav></Nav>
                <Switch>
                <Route path="/Home" exact component = {Home}></Route>
                <Route path="./Components/Page_Principale" component={Page_Principale}></Route>
                <Route path="./Components/Page_Admin" component={Page_Admin}></Route>
                </Switch>
            </div>

        </Router>
    );
}

export default App;
